import React, { useState } from "react";
import "../css/navigationBar.css";

function hoverMenu() {
  return <> </>;
}

export const NavigationButtons = ({ name, onClickEvent, customStyle }) => {
  const [bgColor, setBgColor] = useState("#333647");
  const leaveFunction = () => {
    setBgColor("#333647");
  };
  const enterFunction = () => {
    setBgColor("#7800e0");
  };
  const clickFunction = () => {
    if (onClickEvent === undefined) return;
    onClickEvent();
  };

  return (
    <button
      className="item nav-button"
      onMouseDown={clickFunction}
      onMouseLeave={leaveFunction}
      onMouseEnter={enterFunction}
      style={{ ...customStyle, backgroundColor: bgColor }}
    >
      {name}
    </button>
  );
};
